     console.log(this.state.input);
     app.models.predict("e80301fd2e9743fe9576acb4a154a234","https://samples.clarifai.com/face-dec.jpg").then(
       function(response){
         console.log(response);
       },
       function(err){}
     );
  }

  render(){
    return (
      <div className="App">
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm  onInputChange={this.onInputChange} onSubmit={this.onSubmit}/>
        {/*<ImageLinkForm />
        <FaceRecognition />*/}
      </div>
     );
  }
}
export default App;
